import React, { useRef } from 'react';
import { Link } from 'react-router-dom';

import './Components.scss';

const Navbar = () => {
    const [isActive, setIsActive] = useState();
    const menusOnclick = (e) => {
        e.target.className = 'active';
    };

    return (
        <div className="navbar-container">
            <div className="logo">
                <h1>EXERCISE </h1>
                <h1>LOG.</h1>
            </div>
            <ul className="navMenus-container">
                <li>
                    <Link onClick={menusOnclick} to="/" className="active">
                        Exercise Lists
                    </Link>
                </li>
                <li>
                    <Link onClick={menusOnclick} to="/exercises">
                        Create Exercise
                    </Link>
                </li>
                <li>
                    <Link onClick={menusOnclick} to="/users">
                        Create User
                    </Link>
                </li>
            </ul>
        </div>
    )
};

export default Navbar;
